.tabreq{
    border:3px solid black;
    padding:10px;
   width: 100%;
   overflow: hidden;
   margin-top: 20px;
 }
 .tabreq th{
     text-transform: uppercase;
     text-align: center;
     margin-right: 10px;
     border: 1px solid black;
     width:25%;
     padding: 5px;
     background-color: lightseagreen;
     letter-spacing: 2px;
    
 }
 .tabreq tr td{
     margin-right: 20px;
     border: 1px solid black;
     padding: 3px;
     text-align: center;
     width:25%;
     font-weight: bold;
     letter-spacing: 1px;
     background-color: lightgreen;
     
 }
 .tabreq td:hover{
    background-color: khaki;
